export function Nav() {
  return (
    <nav>
      <div className="navIcons">
        <img src='../img/icon-meditating.svg' />
        <img src='../img/icon-swimming.svg' />
        <img src='../img/icon-cycling.svg' />
        <img src='../img/icon-lifting.svg' />
      </div>
    </nav>
  );
}
